import{_ as c,c as r,o as a,a2 as i,j as t}from"./chunks/framework.4_bZ6nyl.js";const k=JSON.parse('{"title":"2018.05.12 @湖內番茄會社 [假日騎士日誌]","description":"","frontmatter":{"title":"2018.05.12 @湖內番茄會社 [假日騎士日誌]","date":"2018-05-12T09:30:51.000Z","categories":["假日騎士日誌"]},"headers":[],"relativePath":"Bike/BikeTravel/20180512_湖內番茄會社.md","filePath":"Bike/BikeTravel/20180512_湖內番茄會社.md"}'),s={name:"Bike/BikeTravel/20180512_湖內番茄會社.md"},e=i('<p><a href="https://www.strava.com/activities/1570703554" target="_blank"><img src="https://farm1.staticflickr.com/949/40292157580_6c10beaa6c.jpg"></a><br> 現在開始進入初夏，最近換阿勃勒和鳳凰木開始盛開<br> 網路上看到在湖內有一個廢棄的番茄會社，有一株很大的鳳凰木<br> 距離不遠，現在符合現在來回大約50K以內的景點，就去探索</p><p>沿途經過高鐵站，發現阿勃勒比上一週開的更茂盛<br> 當天天氣是陰天，至少拍起來背光不會很嚴重<br><img src="https://farm1.staticflickr.com/974/41198587675_c917af16f6.jpg" alt=""><br><img src="https://farm1.staticflickr.com/968/41198588925_2f5fbb6ca4.jpg" alt=""><br><img src="https://farm1.staticflickr.com/948/28226388108_6ce1c9ee68.jpg" alt=""><br><img src="https://farm1.staticflickr.com/963/41198584135_e048174d35.jpg" alt=""><br><img src="https://farm1.staticflickr.com/960/27229147377_2633093483.jpg" alt=""><br><img src="https://farm1.staticflickr.com/945/27229137947_7c8c0407d6.jpg" alt=""><br> 我發現我還蠻喜歡阿勃勒的，這邊車少索性就在馬路拍起來<br><img src="https://farm1.staticflickr.com/944/41379526074_5d2c94a2b9.jpg" alt=""><br><img src="https://farm1.staticflickr.com/956/28226302548_89194621bf.jpg" alt=""><br><img src="https://farm1.staticflickr.com/976/41379519754_dbc1af1e63.jpg" alt=""><br><img src="https://farm1.staticflickr.com/906/27229124307_03e17d3fb6.jpg" alt=""><br><img src="https://farm1.staticflickr.com/945/41198559105_933eea07b7.jpg" alt=""><br><img src="https://farm1.staticflickr.com/951/41198557635_f5cd42c8fc.jpg" alt=""><br><img src="https://farm1.staticflickr.com/979/41198555345_726c0a338f.jpg" alt=""><br><img src="https://farm1.staticflickr.com/972/41198552495_5cfb17f6c8.jpg" alt=""><br><img src="https://farm1.staticflickr.com/943/41198550095_b672bc4f39.jpg" alt=""><br><img src="https://farm1.staticflickr.com/973/41198544755_5fb1aa617f.jpg" alt=""><br><img src="https://farm1.staticflickr.com/826/42099121671_2a25818b48.jpg" alt=""><br><img src="https://farm1.staticflickr.com/823/42099116061_858a978440.jpg" alt=""><br><img src="https://farm1.staticflickr.com/978/42099104701_75f371131a.jpg" alt=""></p><p>拍完阿勃勒就開始趕路，湖內番茄會社就在台1線旁邊<br> 到的時候還沒八點，旁邊已經停了五六輛車<br> 就找了一條小徑，把單車牽進去，也找較合適的地點靠車<br> 鳳凰木磚紅色加深綠色的葉子，以及老屋還蠻有味道的<br> 當中還有人拿長鏡頭在拍，人也越來越多<br> 後來想說可以去市區看看，說不定還可以看到鳳凰木<br><img src="https://farm1.staticflickr.com/962/28226347368_b10a160ca2.jpg" alt=""><br><img src="https://farm1.staticflickr.com/946/28226358318_d533407fe6.jpg" alt=""><br><img src="https://farm1.staticflickr.com/966/28226345278_8d4c2eae68.jpg" alt=""><br><img src="https://farm1.staticflickr.com/969/28226344298_a6b7d677a7.jpg" alt=""><br><img src="https://farm1.staticflickr.com/946/27229085737_99bdc22028.jpg" alt=""></p><p>後來就去巴克禮公園附近逛逛，結果發現這邊的阿勃勒也開了<br> 旁邊還有阿姨問說，你相機拍得起來嗎? 我用DC當然可以啊<br><img src="https://farm1.staticflickr.com/827/27229071067_bbf91c36de.jpg" alt=""><br><img src="https://farm1.staticflickr.com/831/27229066227_3f49439601.jpg" alt=""><br><img src="https://farm1.staticflickr.com/977/42054266312_f6080492cc.jpg" alt=""><br><img src="https://farm1.staticflickr.com/904/42054264562_1ab56d63f5.jpg" alt=""></p><p>後來回程經過生產路附近的醫院前面有鳳凰木，順手拍了一下<br><img src="https://farm1.staticflickr.com/972/42054261612_538de70dda.jpg" alt=""><br><img src="https://farm1.staticflickr.com/974/42054260052_41a18bedd4.jpg" alt=""><br><img src="https://farm1.staticflickr.com/911/28226311718_2ef9f89d5f.jpg" alt=""><br><img src="https://farm1.staticflickr.com/959/28226308268_7f13c7ca10.jpg" alt=""><br><img src="https://farm1.staticflickr.com/953/28226304188_fa71f39425.jpg" alt=""></p><h2 id="本週心得" tabindex="-1"># 本週心得 <a class="header-anchor" href="#本週心得" aria-label="Permalink to &quot;# 本週心得&quot;">​</a></h2><p>最近比較沒有訓練，速度上不來<br> 自從5/1從彰化騎回來騎到有點膩之後，最近比較沒在訓練<br> 感覺踏頻、速度有點上不來，就維持時速25~30左右</p><h2 id="下集預告" tabindex="-1"># 下集預告 <a class="header-anchor" href="#下集預告" aria-label="Permalink to &quot;# 下集預告&quot;">​</a></h2><p>這幾週應該都會持續追阿勃勒跟鳳凰木<br> 等六月後再找其他景點</p>',9),m=t("div",{class:"embedly-responsive",style:{position:"relative","padding-bottom":"78.2227%",height:"0",overflow:"hidden"}},[t("iframe",{class:"embedly-embed",frameborder:"0",scrolling:"no",allowfullscreen:"",src:"https://cdn.embedly.com/widgets/media.html?src=https://www.relive.cc/view/vevYNN28JOK/widget?r=embed-site&url=https://www.relive.cc/view/vevYNN28JOK?r=embed-site&image=https://www.relive.cc/view/vevYNN28JOK/png?x-ref=embed-site&key=f1631a41cb254ca5b035dc5747a5bd75&type=text/html&schema=relive",width:"1024",height:"801",style:{position:"absolute",top:"0",left:"0",width:"100%",height:"100%"}})],-1),f=[e,m];function l(p,b,o,g,_,h){return a(),r("div",null,f)}const n=c(s,[["render",l]]);export{k as __pageData,n as default};
